Epic slice tour of brooklyn yesterday with my dude @gabehiatt  It’s hard to narrow down a slice tour of a borough bigger than most cities but we came up w a pretty laser focused group of six. Listed in geographic order from south to north. It’s a mix of old school & new school. So many more could have been included but our stomachs can only hold so many slices in one day.

Starting with
@lucia.newyork 
Slices were so on point, vodka sauce may have been my favorite of the day
@difarapizzanyc 
So happy for Dom Jr. who really has the place performing at the level of his legendary father
@luigispizzaparkslope 
Gio is an absolute legend in the game, the fresh mozzarella slice was a great alternative to the plain slice, the grandma was insanely light & full of flavor, and the price! You can’t find a better deal in nyc.
@fandfpizzeria 
Nothing but great vibes & the garden is a slice of heaven, ingredients here about as good as you will find on any slice, great flavor in sourdough crust & the Sicilian was fantastic
@bestpizza33 
The place that really started the slice revival, great ingredients, one of the few wood fired slice shops in nyc, and not pictured is the white slice, which is the best in the city 
@lindustriebk 
Crazy light & crispy crust, flavors all fully on point, my go to is the veggie slice, but the burrata slice is definitely their signature, also Cantaloupe Sorbetto is mind blowing.

What’s your favorite slice? What did I miss? What’s new? Holler in the comments, let’s talk brooklyn slices!

Taking inspiration from the 3 greatest pizza cities in the world, Napoli, New York & São Paulo, @brazelettrica is made w great ingredients & cooked in 90 seconds like Naples, it’s meant to eat w your hands on the go like NYC, and it’s got all the familiar flavors & style of São Paulo. On my last visit to Brazil we shot some fun videos, check it out! 

