My Muffuletta is a labor or love! 💚🤍❤️ it starts with an all naturally leavened ambient temperature raised 12 inch seeded focaccia loaf, baked fresh then lightly toasted. The chopped olive is a mix of Sicilian black & castelvetrano olives, giardiniera pickled from vegetables from local farmers market. Next comes some slabs of freshly pulled mozzarella, I toast again to melt the mozzarella a little, then come the beautiful meats from Fra’ Mani, salame rosa, spicy capicollo, soppressata, and of course a very healthy portion of thinly sliced Mortadella. On top of the meats I sprinkle some pistachio powder, black pepper, tons of parmigiano, and then some pickled red onions. Some extra virgin olive oil get drizzled on the top & that’s it! 

So far I have taken the Muffuletta tour to Williamsburg, Nashville, and Charleston. Where should the next Muffuletta party be?? Thanks again to my host @aandcsuper & @eatframani for supporting this crazy sandwich party!

